from sympy import primefactors
def octagonal(n): return n*(3*n - 2)
def a(n):
    k = 1
    while len(primefactors(octagonal(k))) != n: k += 1
    return octagonal(k)
print([a(n) for n in range(1, 10)]) # _Michael S. Branicky_, Aug 21 2021

